import React, { Component } from 'react';
import './App.css';
import Movie from "./Movie";

const movies = [
  {
    title: "스파이더맨 파 프롬 홈",
    poster: "https://upload.wikimedia.org/wikipedia/ko/thumb/c/cb/%EC%8A%A4%ED%8C%8C%EC%9D%B4%EB%8D%94%EB%A7%A8_%ED%99%88%EC%BB%A4%EB%B0%8D.jpg/250px-%EC%8A%A4%ED%8C%8C%EC%9D%B4%EB%8D%94%EB%A7%A8_%ED%99%88%EC%BB%A4%EB%B0%8D.jpg"
  },
  {
    title: "가디언즈 오브 갤럭시",
    poster: "https://terrigen-cdn-dev.marvel.com/content/prod/1x/guardiansofthegalaxyvol.2_lob_crd_01.jpg"
  },
  {
    title: "앤트맨과 와스프",
    poster: "https://upload.wikimedia.org/wikipedia/ko/thumb/5/52/%EC%95%A4%ED%8A%B8%EB%A7%A8%EA%B3%BC_%EC%99%80%EC%8A%A4%ED%94%84.jpg/250px-%EC%95%A4%ED%8A%B8%EB%A7%A8%EA%B3%BC_%EC%99%80%EC%8A%A4%ED%94%84.jpg"
  },
  {
    title: "엔드 게임",
    poster: "https://upload.wikimedia.org/wikipedia/ko/f/f2/%EC%96%B4%EB%B2%A4%EC%A0%B8%EC%8A%A4-_%EC%97%94%EB%93%9C%EA%B2%8C%EC%9E%84_%ED%8F%AC%EC%8A%A4%ED%84%B0.jpg"
  },
]


export default class App extends Component {
  render() {
    return (
      <div className="App">
        {movies.map(movie => {
          return <Movie title={movie.title} poster={movie.poster} />
        })}
      </div>
    );
  }
}
